import React from "react";
import "./ImagesSection.css";

const images = [
  "/images/img1.jpg",
  "/images/img2.jpg",
  "/images/img3.jpg",
  "/images/img4.jpg",
  "/images/img5.jpg",
  "/images/img6.jpg",
  "/images/img7.jpg",
];

export default function ImagesSection() {
  return (
    <section className="images-section">
      <div className="images-container" aria-label="Gallery of images">
        {images.map((src, i) => (
          <figure key={i} className="image-item">
            <img src={src} alt={`Gallery image ${i + 1}`} />
          </figure>
        ))}
      </div>

      <p className="center-text">
        This is a centered paragraph describing the images.
      </p>

      <div className="button-wrap">
        <button className="center-button">Click me</button>
      </div>
    </section>
  );
}
